import React from "react";
import "./cta.css";

const JOIN = () => (
  <div className="cta">
    <div className="cta-content">
      <p></p>
      <h3>
        Interested in joining the WolvesDAO? Fill out an application to share
        your skillset with us now
      </h3>
    </div>
    <div className="cta-btn">
      <button type="button">Get Started</button>
    </div>
  </div>
);

export default JOIN;
